import React, { useState, useEffect } from 'react';
import axios from 'axios';

import { Container, Row, Col, Card } from 'react-bootstrap';

import Button from '../../../utils/Button';

export default function SelezioneMoto() {


    const [moto, setMoto] = useState([]);

    useEffect(() => {

        async function loadMoto() {

            var data = JSON.stringify({
                indirizzoStallo: localStorage.getItem("luogoRitiro"),
                categoriaMezzo: localStorage.getItem("TIPOVEICOLO")
            });

            var config = {
                method: 'post',
                url: '/api/fetch/veicolidisponibilistallo',
                headers: {
                    'Content-Type': 'application/json'
                },
                data: data
            };

            axios(config)
                .then(function (response) {
                    console.log(JSON.stringify(response.data));
                    //localStorage.setItem("targaVeicoloPrenotato", (JSON.parse(JSON.stringify(response.data.listaMezzi))[0].targa));
                    setMoto(response.data.listaMezzi);
                })
                .catch(function (error) {
                    console.log(error);
                    alert("Qualcosa Ã¨ andato storto con la prenotazione. Riprova...");
                });

        }

        loadMoto();

    }, []);

    let authToken = localStorage.getItem('authToken');

    if (!authToken) {
        window.location.replace("/login");
    } else {
        let tipoUtente = localStorage.getItem('tipoUtente');

        if (tipoUtente !== "Cliente") {
            window.location.replace("/");
        } else {

            let TIPOVEICOLO = localStorage.getItem('TIPOVEICOLO')

            let immagine;
            let nomeVeicolo;

            if(TIPOVEICOLO === "49") {
                nomeVeicolo = "Piaggio Liberty 50cc";
                immagine = " data:image/png;base64,";
            }

            if (TIPOVEICOLO === "125") {

                nomeVeicolo = "Piaggio Medley 125cc";
                immagine = " data:image/png;base64,";
            }

            async function programmaPrenotazione(targa) {

                var data = JSON.stringify({
                    emailCliente: JSON.parse(localStorage.getItem("datiPersonali")).email,
                    targaVeicolo: targa,
                    luogoConsegna: localStorage.getItem("luogoConsegna"),
                    dataRitiro: localStorage.getItem("dataRitiro"),
                    oraRitiro: localStorage.getItem("oraRitiro"),
                    dataConsegna: localStorage.getItem("dataConsegna"),
                    oraConsegna: localStorage.getItem("oraConsegna"),
                    numeroCartaCliente: localStorage.getItem("numeroCartaCliente")
                });

                var config = {
                    method: 'post',
                    url: '/api/prenotazione/programmaprenotazione',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    data: data
                };

                axios(config)
                    .then(function (response) {
                        console.log(JSON.stringify(response.data));

                        localStorage.setItem("IDPrenotazione", JSON.parse(JSON.stringify(response.data.datiPrenotazione))._id)
                        window.location.replace("/prenotazionecompletata");

                    })
                    .catch(function (error) {
                        console.log(error);
                    });
            }
            return (
                <React.Fragment>
                    <Container className="mt-5">
                        <div>
                            <h1 className="t-bold text-center my-5">Seleziona Moto</h1>
                        </div>
                    </Container>
                    <Container className="mt-2 mb-5">
                        <Row className="mb-100">
                                    <div>
                                    <Row className="gy-4 mb-5">
                                        {moto.map((scooter) => (
                                            <Col xs={{ span: 10, offset: 1 }} xl={{ span: 4, offset: 1 }}>
                                            <Card className="h-100 border-5 shadow">
                                                <Card.Header className="border-3 shadow"><center><h2 className="card-title">{nomeVeicolo}</h2></center></Card.Header>
                                                <Card.Img variant="top" src={immagine} />
                                                <Card.Body className="d-flex flex-column justify-content-evenly">
                                                    <div className=" py-1 justify-content-center">

                                                        <p className=" h4 card-text py-1 t-bold">Categoria: <a className="t-light"><font color = "black"> {scooter.categoriaMezzo}</font></a></p>

                                                        <p className=" h4 t-bold card-text py-1">Alimentazione: <a className="t-light"><font color = "black">  Benzina </font></a></p>

                                                        <p className=" h4 t-bold card-text py-1">Targa: <a className="t-light"><font color = "black">   {scooter.targa} </font></a></p>

                                                        <p className=" h4 t-bold card-text py-1">Prezzo orario: <a className="t-light"><font color = "black">  {scooter.prezzoOrario} â¬ </font></a></p>

                                                    </div>

                                                    <div className="d-flex justify-content-end">
                                                        <Button className="button-menu" variant="outline-secondary" onClick = {() => programmaPrenotazione(scooter.targa)}>Seleziona Moto</Button>
                                                    </div>
                                                </Card.Body>
                                            </Card>
                                            </Col>
                                        ))}              
                                </Row>
                                </div>
                        </Row>
                    </Container>
                </React.Fragment>
            );
        }
    }
    
}